const ExploreMenu = () => {
  return (
    <div>
      <div className='mb-2' ><h1 className='text-4xl font-semibold' >Explore our menu</h1></div>
      <div>
        <div className='w-44' >Choose from a diverse menu featuring a delectable array of dishes. Our mission is to satisfy your cravings and elevate your dining experience, one delicious meal at a time.</div>
      </div>
    </div>
  )
}

export default ExploreMenu
